using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace xstrat.Json
{
    public class XMap
    {
        public string Name { get; set; }
        public int game_id { get; set; }
        public List<Floor> floors { get; set; } = new List<Floor>();

        public XMap(string name, int game_id, List<Floor> floors)
        {
            Name = name;
            this.game_id = game_id;
            this.floors = floors;
        }

        public XMap()
        {
            floors.Add(new Floor(0, "basement", @"", 0));
            floors.Add(new Floor(1, "first floor", @"", 0));
            Name = "Demo";
        }

        public List<(string, string)> getFloors()
        {
            var list = new List<(string, string)>();
            foreach (var floor in floors)
            {
                list.Add((floor.name, floor.image));
            }
            return list;
        }
    }
}
